    // map

    /**
     * @throws ReflectionException
     */
    public function map()
    {
//        $this->mapCacheClear();
        $funcs = S('funcs');
        if (empty($funcs)) {
            $excel_class = A('Excel');
            $func = S('func');
            if (empty($func)) {
                $func = get_class_methods(get_class($excel_class));
                S('func', $func, 14400);
            }
            $remove_array = S('remove_array');
            if (empty($remove_array)) {
                $remove_array = array_merge(get_class_methods(get_class(A('Base'))), ['__construct', 'map', 'mapCacheClear']);
                S('remove_array', $remove_array, 14400);
            }
            foreach ($func as $value) {
                if (in_array($value, $remove_array)) {
                    continue;
                }
                $reflection = new ReflectionMethod($excel_class, $value);
                $docComment = $reflection->getDocComment();
                $funcs[$value] = str_replace(['/**', '*/'], '', $docComment);
            }
        }
        $this->assign('funcs', $funcs);
        $this->display();
    }

