    }

    /**
     * #9409 供应商数据导出
     */
    public function supplierDataExport()
    {
        $sql = "SELECT
                    SP_NAME,
                    CONCAT(
                        site_1.`NAME`,
                  		IFNULL(site_3.`NAME`, ''),
		                IFNULL(site_4.`NAME`, '')
                    ) AS 'registered_address',
                    CONCAT(
                        site_5.`NAME`,
                    	IFNULL(site_7.`NAME`, ''),
		                IFNULL(site_8.`NAME`, '')
                    ) AS 'office_address',
                    tb_ms_cmn_cd.CD_VAL AS 'type_enterprise'
                FROM
                    tb_crm_sp_supplier
                LEFT JOIN tb_crm_site AS site_1 ON site_1.ID = tb_crm_sp_supplier.SP_ADDR1
                LEFT JOIN tb_crm_site AS site_3 ON site_3.ID = tb_crm_sp_supplier.SP_ADDR3
                LEFT JOIN tb_crm_site AS site_4 ON site_4.ID = tb_crm_sp_supplier.SP_ADDR4
                LEFT JOIN tb_crm_site AS site_5 ON site_5.ID = tb_crm_sp_supplier.SP_ADDR5
                LEFT JOIN tb_crm_site AS site_7 ON site_7.ID = tb_crm_sp_supplier.SP_ADDR7
                LEFT JOIN tb_crm_site AS site_8 ON site_8.ID = tb_crm_sp_supplier.SP_ADDR8
                LEFT JOIN tb_ms_cmn_cd ON tb_ms_cmn_cd.CD = tb_crm_sp_supplier.COPANY_TYPE_CD
                WHERE
                    DATA_MARKING = 0";
        $data = $this->model->query($sql);
        $claim_list = [
            ['SP_NAME', '公司'],
            ['registered_address', '注册地址'],
            ['office_address', '办公地址'],
            ['type_enterprise', '企业类型'],
        ];
        $this->service->outputExcel('供应商',
            $claim_list,
            $data
        );
    }

    /**
     * # 调拨
     */
    public function alloOnWayExport()
    {
        $sql = 'SELECT
         b.allo_no AS 调拨单号,
         (SELECT e.CD_VAL FROM tb_ms_cmn_cd e WHERE e.cd = b.allo_out_team) AS 调出团队,
         (SELECT e.CD_VAL FROM tb_ms_cmn_cd e WHERE e.cd = b.allo_out_warehouse) AS 调出仓库,
         (SELECT e.CD_VAL FROM tb_ms_cmn_cd e WHERE e.cd = b.allo_in_warehouse) AS 调入仓库,
         c.SKU_ID,
         c.batch_code AS 批次号,
         a.occupy_num AS 数量,
         d.unit_price AS 采购单价
        FROM
         tb_wms_batch_order a
        INNER JOIN tb_wms_allo b ON a.ORD_ID = b.allo_no
        LEFT JOIN tb_wms_batch c ON a.batch_id = c.id
        LEFT JOIN tb_wms_stream d ON c.stream_id = d.id
        WHERE
         b.state = \'N001970300\'
        AND a.use_type = 10';
        $data = M()->query($sql);
        $map = [
            ['field_name' => '调拨单号', 'name' => '调拨单号'],
            ['field_name' => '调出团队', 'name' => '调出团队'],
            ['field_name' => '调出仓库', 'name' => '调出仓库'],
            ['field_name' => '调入仓库', 'name' => '调入仓库'],
            ['field_name' => 'SKU_ID', 'name' => 'SKU_ID'],
            ['field_name' => '批次号', 'name' => '批次号'],
            ['field_name' => '数量', 'name' => '数量'],
            ['field_name' => '采购单价', 'name' => '采购单价'],
        ];
        $this->exportCsv($data, $map);
    }

