    /**
     * 9563 采购明细数据导出
     */
    public function purExport()
    {
        $model = new Model();
        $map = [
            ['field_name' => 'procurement_number', 'name' => '采购单号'],
            ['field_name' => 'supplier_id', 'name' => '供应商'],
            ['field_name' => 'amount_currency_val', 'name' => '订单币种'],
            ['field_name' => 'amount', 'name' => '订单金额'],
            ['field_name' => 'money_paid_over_all', 'name' => '订单综合付款金额'],
            ['field_name' => 'sku_information', 'name' => 'SKU'],
            ['field_name' => 'goods_name', 'name' => '商品名称'],
            ['field_name' => 'total_in_warehouse_num', 'name' => '总入库数量'],
            ['field_name' => 'unit_price', 'name' => '单价（含增值税）'],
            ['field_name' => 'unit_expense', 'name' => 'PO内费用单价'],
            ['field_name' => 'prepared_by', 'name' => '采购人员']
        ];
        $sql = "SELECT
            rel.relevance_id,
            od.order_id,
            od.procurement_number,
            od.supplier_id,
            od.amount_currency,
            od.amount,
            gi.sku_information,
            gi.goods_name,
            gi.unit_price,
            gi.unit_expense,
            rel.prepared_by,
            (
                SELECT
                    TRUNCATE (
                        SUM(
                            TRUNCATE (
                                amount_account * exchange_tax_account,
                                2
                            )
                        ),
                        2
                    )
                FROM
                    tb_pur_payment
                WHERE
                    relevance_id = rel.relevance_id
            ) money_paid
        FROM
            tb_pur_relevance_order rel
        LEFT JOIN tb_pur_order_detail od ON rel.order_id = od.order_id
        LEFT JOIN tb_pur_goods_information gi ON rel.relevance_id = gi.relevance_id
        GROUP BY
            relevance_id,
            sku_information";
        $list = $model->query($sql);
        $list = CodeModel::autoCodeTwoVal($list, ['amount_currency']);
        $order_ids = array_unique(array_column($list, 'order_id'));
        $relevance_ids = " '" . join("','", array_unique(array_column($list, 'relevance_id'))) . "' ";
        $refund = D('TbFinClaim')
            ->field('t.id,a.account_transfer_no,a.currency_code,t.claim_amount,t.order_id,od.amount_currency,rel.sou_time')
            ->alias('t')
            ->join('tb_fin_account_turnover a on a.id=t.account_turnover_id')
            ->join('left join tb_pur_order_detail od on t.order_id=od.order_id')
            ->join('left join tb_pur_relevance_order rel on rel.order_id=od.order_id')
            ->where(['t.order_id' => ['in', $order_ids], ['t.order_type' => 'N001950600']])
            ->select();

        $money_refund = [];
        foreach ($refund as $v) {
            $return_rate = exchangeRateConversion(cdVal($v['currency_code']), cdVal($v['amount_currency']), str_replace('-', '', $v['sou_time']));
            $money_refund[$v['order_id']] += bcmul($v['claim_amount'], $return_rate, 2);
        }

        $sql = "SELECT
            CONCAT(gi.relevance_id,gi.sku_information) AS tag,
            sum(
                sg.warehouse_number + sg.warehouse_number_broken
            ) AS in_warehouse_num
        FROM
            tb_pur_goods_information gi
        LEFT JOIN tb_pur_ship_goods sg ON gi.information_id = sg.information_id
        WHERE
            gi.relevance_id IN ({$relevance_ids})
        GROUP BY
            gi.relevance_id,
            sku_information";
        $in_warehouse_info = $model->query($sql);
        $in_warehouse = array_column($in_warehouse_info, 'in_warehouse_num', 'tag');

        $sql = "SELECT
            CONCAT(gi.relevance_id,gi.sku_information) AS tag,
            sum(
                rg.return_number
            ) AS return_num
        FROM
            tb_pur_goods_information gi
        LEFT JOIN tb_pur_return_goods rg ON gi.information_id = rg.information_id
        WHERE
            gi.relevance_id IN ({$relevance_ids})
        GROUP BY
            gi.relevance_id,
            sku_information";
        $return_warehouse_info = $model->query($sql);
        $return_warehouse = array_column($return_warehouse_info, 'return_num', 'tag');

        foreach ($list as &$item) {
            $item['money_paid_over_all'] = bcsub($item['money_paid'], $money_refund[$item['order_id']], 2) ?: 0.00;
            $in_warehouse_num = $in_warehouse[$item['relevance_id'] . $item['sku_information']];
            $return_warehouse_num = $return_warehouse[$item['relevance_id'] . $item['sku_information']];
            $item['total_in_warehouse_num'] = $in_warehouse_num - $return_warehouse_num ?: 0;
        }
        $this->exportCsv($list, $map);
    }

