    /**
     * #
     */
    public function tppSearch()
    {
        set_time_limit(0);
        ini_set('memory_limit', '512M');
        $start = $_GET['start'];
        $end = $_GET['end'];
        $p = $_GET['p'];
        if (!empty($p)) {
            $start = ($p - 1) * 1000;
            $end = 1000;
        }
//        if (empty($start || empty($end))) {
//            $start = 0;
//            $end = 1000;
//        }
        $model = new Model();
        $sql_p = 'SELECT
                s.sku_id,
                price.country_id,
                sum(stock.sku_stock) AS stock_num
            FROM ' .
            PMS_DATABASE . '.product_sku s
            INNER JOIN ' . PMS_DATABASE . '.product_sku_stock stock ON s.sku_id = stock.sku_id
            INNER JOIN ' . PMS_DATABASE . '.product_price price ON price.sku_id = stock.sku_id
            AND price.warehouse = stock.warehouse
            GROUP BY
                s.sku_id,
                price.country_id';
        $product = $model->query($sql_p);
        $product_map = [];
        foreach ($product as $item) {
            $product_map[$item['sku_id'] . $item['country_id']] = $item['stock_num'];
        }
        unset($product);
//        $sku_map = (new PmsBaseModel())->table('product_sku')->limit($start,$end)->getField('sku_id,sale_states');
        //->where(['sku_id'=>['lt','8000024001']])
        $count = (new PmsBaseModel())->table('product_sku')->count();

        $country = M('user_area', 'tb_ms_')->field('id,zh_name')->where(['parent_no' => 0])->select();

        $country_field = array_unique(array_column($country, 'zh_name'));
        array_unshift($country_field, '');

        $sql = 'SELECT
                guds.B5C_SKU_ID,
                oo.ADDRESS_USER_COUNTRY_ID
            FROM
                tb_op_order oo
            LEFT JOIN tb_op_order_guds guds ON oo.ORDER_ID = guds.ORDER_ID
            WHERE
                oo.PLAT_CD NOT IN (
                    "N000831400",
                    "N000837401",
                    "N000837402",
                    "N000837403",
                    "N000837404",
                    "N000837405",
                    "N000837406",
                    "N000837407",
                    "N000837408",
                    "N000837409",
                    "N000834300",
                    "N000834200",
                    "N000834100"
                )
            AND oo.ORDER_TIME > "2018-12-31 23:59:59"
            AND oo.ADDRESS_USER_COUNTRY_ID IS NOT NULL
            AND guds.B5C_SKU_ID IS NOT NULL
            AND oo.CHILD_ORDER_ID IS NULL
            GROUP BY
                oo.ADDRESS_USER_COUNTRY_ID,
                guds.B5C_SKU_ID';
        $orders = $model->query($sql);
        $order_map = [];
        foreach ($orders as $order) {
            $order_map[$order['B5C_SKU_ID'] . $order['ADDRESS_USER_COUNTRY_ID']] = true;
        }
        unset($orders);

//        $filename = date('Ymd') . '.csv'; //设置文件名
//        header('Content-Type: application/vnd.ms-excel;charset=utf-8');
//        header('Content-Disposition: attachment;filename="' . $filename . '"');
//        header('Cache-Control: max-age=0');
//        $out = fopen('php://output', 'w');

        $sqlLimit = 1000;//每次只从数据库取100000条以防变量缓存太大
        $limit = 1000;
        // buffer计数器
        $cnt = 0;
        for ($i = 0; $i < ceil($count / $sqlLimit); $i++) {
            $fp = fopen($i . '.csv', 'w'); //生成临时文件
            $fileNameArr[] = $i . '.csv';
            fputcsv($fp, $country_field);
            $sku_map = (new PmsBaseModel())->table('product_sku')->limit($i * $sqlLimit, $sqlLimit)->getField('sku_id,sale_states');

            foreach ($sku_map as $sku_id => $v) {
                $cnt++;
                $line = [];
                $line[] = $sku_id;
                foreach ($country as $item) {
                    $condition2 = $condition1 = false;
                    if ($order_map[$sku_id . $item['id']]) {
                        //满足条件一
                        $condition1 = true;
                    }
                    if ((isset($product_map[$sku_id . $item['id']]) && $product_map[$sku_id . $item['id']] > 0) && $v == 'N000100100') {
                        //满足条件二
                        $condition2 = true;
                    }
                    if ($condition1 && $condition2) {
                        $line[] = 3;
                    } else if ($condition1 && !$condition2) {
                        $line[] = 2;
                    } else if (!$condition1 && $condition2) {
                        $line[] = 1;
                    } else {
                        $line[] = 0;
                    }
                }
                if ($limit == $cnt) {
                    //刷新一下输出buffer，防止由于数据过多造成问题
                    ob_flush();
                    flush();
                    $cnt = 0;
                }
                fputcsv($fp, $line);
            }
            fclose($fp);
        }
        $zip = new ZipArchive();
        $filename = "0.zip";
        $zip->open($filename, ZipArchive::CREATE);   //打开压缩包
        foreach ($fileNameArr as $file) {
            $zip->addFile($file, basename($file));   //向压缩包中添加文件
        }
        $zip->close();  //关闭压缩包
        //输出压缩文件提供下载
        header("Cache-Control: max-age=0");
        header("Content-Description: File Transfer");
        header('Content-disposition: attachment; filename=' . basename($filename)); // 文件名
        header("Content-Type: application/zip"); // zip格式的
        header("Content-Transfer-Encoding: binary"); //
        header('Content-Length: ' . filesize($filename)); //
//        @readfile($filename);//输出文件;
        v(memory_get_usage());
    }

