    /**
     * @param $file_name
     *
     * @return Generator
     */
    private function readYieldFile($file_name)
    {
        $handle = fopen($file_name, 'rb');
        while (!feof($handle)) {
            yield fgetcsv($handle, 6000, ',');
        }
        fclose($handle);
    }

    /**
     * @param $where_str
     *
     * @return array
     */
    private function countOrderAmount($where_str)
    {

        $model = new Model();
        $sql = "SELECT
                guds.ITEM_PRICE,
                guds.ITEM_COUNT,
                oo.PAY_CURRENCY,
                guds.B5C_SKU_ID,
                oo.ADDRESS_USER_COUNTRY_ID
            FROM
                tb_op_order oo
            LEFT JOIN tb_op_order_guds guds ON oo.ORDER_ID = guds.ORDER_ID AND oo.PLAT_CD= guds.PLAT_CD
            WHERE
                oo.ORDER_TIME > '2018-12-31 23:59:59'
            AND oo.ADDRESS_USER_COUNTRY_ID IS NOT NULL
            AND guds.B5C_SKU_ID IS NOT NULL
            AND oo.PARENT_ORDER_ID IS NULL
            AND $where_str";
        $list = $model->query($sql);
        $amount_map = [];
        foreach ($list as $item) {
            $currency = strtoupper(trim($item['PAY_CURRENCY']));
            if ($currency == 'USD') {
                $amount_map[$item['B5C_SKU_ID'] . $item['ADDRESS_USER_COUNTRY_ID']] += $item['ITEM_PRICE'] * $item['ITEM_COUNT'];
            } else {
                $rate = exchangeRateConversion($currency, 'USD', date('Ymd'));
                $amount_map[$item['B5C_SKU_ID'] . $item['ADDRESS_USER_COUNTRY_ID']] += $item['ITEM_PRICE'] * $item['ITEM_COUNT'] * $rate;
            }
        }
        foreach ($amount_map as $k => $item) {
            $amount_map[$k] = number_format($item, 2);
        }
        unset($list);
        return $amount_map;
    }

    /**
     * tppDataHandle
     */
    public function tppDataHandle()
    {
        $file_name = $_GET['f'];
        if (empty($file_name)) {
            die('未设置文件');
        }
        set_time_limit(0);
        ini_set('memory_limit', '512M');
        $file_name = 'TPP' . $file_name . '.csv'; //设置文件名
        $country = M('user_area', 'tb_ms_')->where(['parent_no' => 0])->getField('zh_name,id');
        $country_map = [];
        foreach ($country as $k => $v) {
            $country_map[trim($k)] = $v;
        }
        unset($country);
        $head = '';
        $count = 0;
        $csv_data = [];
        $where_str = '(';

        $filename = date('Ymd') . $file_name; //设置文件名
        header('Content-Type: text/csv');
        header("Content-type:text/csv;charset=gb2312");
        header("Content-Disposition: attachment;filename={$filename}");
        echo chr(0xEF) . chr(0xBB) . chr(0xBF);
        $out = fopen('php://output', 'w');
        $data = $this->readYieldFile($file_name);
        foreach ($data as $item) {
            foreach ($item as &$v) {
                $v = trim(iconv('gb2312', 'utf-8', $v));
            }
            $sku_id = $item[0];
            if (empty($head)) {
                $head = $item;
                fputcsv($out, $head);
            } else {
                foreach ($item as $k => &$value) {
                    if ($k < 2) {
                        continue;
                    }
                    if ($value != 2) {
                        continue;
                    }
                    $count++;
                    $country_id = $country_map[$head[$k]];
                    $where_str .= "( guds.B5C_SKU_ID = '{$sku_id}' AND oo.ADDRESS_USER_COUNTRY_ID = $country_id) OR ";
                    $value = 'amount';
                }
                $csv_data[] = $item;
                unset($item);
            }
        }
        $where_str = trim($where_str, 'OR ') . ')';
        $order_map = $this->countOrderAmount($where_str);
        $where_str = '';
        foreach ($csv_data as $item) {
            foreach ($item as $k => &$v) {
                if ($v == 'amount') {
                    $v = $order_map[$item[0] . $country_map[$head[$k]]];
                }
            }
            fputcsv($out, $item);
            unset($item);
        }
        unset($order_map);
        unset($country_map);
        fclose($out);
        Logs($count, __FUNCTION__, 'fm');
    }

