    /**
     * 9906 B2B订单数据查询
     */
    public function b2bDataExport()
    {
        $model = new Model();
        $sql = "SELECT
            b.procurement_number, o.ID AS 'b2b_id',o.PO_ID
        FROM
            tb_wms_bill b
        INNER JOIN tb_b2b_order o ON o.PO_ID = SUBSTRING_INDEX(b.link_bill_id, '_', 1)
        WHERE
            b.relation_type = 'N002350400'
        AND b.procurement_number IS NOT NULL
        GROUP BY
            link_bill_id,
            procurement_number";
        $list = $model->query($sql);
        foreach ($list as $item) {
            $b2b_ids[] = $item['b2b_id'];
            $b2b_pur_map[$item['b2b_id']][] = $item['procurement_number'];
        }
        $b2b_ids = array_unique($b2b_ids);
        $b2b_goods = M('goods','tb_b2b_')->field('ORDER_ID,price_goods,SKU_ID')->where(['ORDER_ID' => ['in', $b2b_ids]])->select();
        foreach ($b2b_goods as $goods) {
            $b2b_goods_map[$goods['ORDER_ID']][$goods['SKU_ID']] = $goods['price_goods'];
        }
        $data = [];
        foreach ($list as $item) {
            if (!$item['procurement_number']) {
                continue;
            }
            $pur_map = $pur_map_sp = [];
            $total_price = $total_one_pur_price = 0;
            $pur_list = $model->table('tb_pur_relevance_order rel')
            ->field('od.procurement_number,gi.sku_information,gi.goods_number')
            ->join('left join tb_pur_order_detail od on rel.order_id = od.order_id')
            ->join('left join tb_pur_goods_information gi on rel.relevance_id = gi.relevance_id')
            ->where(['od.procurement_number' => ['in',$b2b_pur_map[$item['b2b_id']]]])
            ->select();
            foreach ($pur_list as $v) {
                $pur_map_sp[$v['sku_information']] += $v['goods_number'];
                $pur_map[$v['procurement_number']][$v['sku_information']] += $v['goods_number'];
            }
            foreach ($b2b_goods_map[$item['b2b_id']] as $sku_id => $price) {
                $total_price += $price * $pur_map_sp[$sku_id];
            }
            foreach ($b2b_goods_map[$item['b2b_id']] as $sku_id => $price) {
                $total_one_pur_price += $price * $pur_map[$item['procurement_number']][$sku_id];
            }
            $rate = bcmul(bcdiv($total_one_pur_price,$total_price,4),100,2) .'%';
            $data[] = [
                'b2b_no' => $item['PO_ID'],
                'procurement_number' => $item['procurement_number'],
                'rate' => $rate,
            ];
        }
        $map = [
            ['field_name' => 'b2b_no', 'name' => 'B2B订单号'],
            ['field_name' => 'procurement_number', 'name' => '采购单号'],
            ['field_name' => 'rate', 'name' => '占比'],
        ];
        $this->exportCsv($data, $map);
    }

