    /**
     * 10570 派单后编辑SKU的订单导出
     */
    public function editedOrderSkuExport()
    {
        set_time_limit(0);
        $type = I('type');
        $start = I('start');
        $end = I('end');

        if ($type) {
            $table = 'sms_ms_ord_hist_0323';
        } else {
            $table = 'sms_ms_ord_hist';
        }
        $data = [];
        $model = new Model();
        $sql = "SELECT
            oh.ORD_NO,
            oh.plat_cd,
            oh.ORD_HIST_HIST_CONT,
            oh.updated_time
        FROM
            $table oh
            LEFT JOIN tb_op_order op ON op.ORDER_ID = oh.ORD_NO 
            AND op.PLAT_CD = oh.plat_cd 
        WHERE
            oh.ORD_HIST_HIST_CONT LIKE 'SKU ID 由 %' 
            AND op.SEND_ORD_STATUS NOT IN ( 'N001820100', 'N001821000' ) 
            and oh.updated_time > '2019-12-31 23:59:59'
        GROUP BY
            oh.ORD_NO,oh.plat_cd LIMIT $start, $end;";
        $list = $model->query($sql);
        $sms_model = M('ms_ord_hist', 'sms_');
        foreach ($list as $item) {
            $row = $sms_model->where(['ORD_NO'=>$item['ORD_NO'], 'plat_cd'=>$item['plat_cd']])->order('id asc')->select();
            $msg = array_column($row, 'ORD_HIST_HIST_CONT', 'id');
            $date = array_column($row, 'updated_time', 'id');
            krsort($msg);
            $pos = array_search('派单状态回退至待派单', $msg);
            if (false !== $pos) {
                //有退回
                $row = $sms_model->where(['ORD_NO'=>$item['ORD_NO'], 'plat_cd'=>$item['plat_cd'], 'updated_time'=>['gt',$date[$pos]]])->select();
                $msg = array_column($row, 'ORD_HIST_HIST_CONT', 'id');
                $date = array_column($row, 'updated_time', 'id');
            }
            $pos = array_search('派单成功', $msg);
            $res = $sms_model->where(['ORD_NO'=>$item['ORD_NO'], 'plat_cd'=>$item['plat_cd'], 'updated_time'=>['gt',$date[$pos]], 'ORD_HIST_HIST_CONT'=>['like','SKU ID 由 %']])->order('id asc')->find();
            if (empty($res)) {
                continue;
            }
            $temp = $model->table('tb_op_order oo')
                ->field(['oo.ORDER_NO,oo.PLAT_CD,oo.WAREHOUSE,ms.STORE_NAME'])
                ->join('tb_ms_store ms on ms.ID = oo.STORE_ID')
                ->where(['oo.ORDER_ID'=>$item['ORD_NO'], 'oo.PLAT_CD'=>$item['plat_cd']])
                ->find();
            $temp['updated_time'] = $res['updated_time'];
            $temp['ORD_HIST_WRTR_EML'] = $res['ORD_HIST_WRTR_EML'];
